import React, { Component } from 'react';
import AddBoxIcon from '@material-ui/icons/AddBox';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import { Box, createMuiTheme, Divider, Drawer, List, ListItem, ThemeProvider, Toolbar } from '@material-ui/core';
import ListItemIcon from '@material-ui/core/ListItemIcon';

const theme = createMuiTheme();

const styles = {
    root: {
        display: 'flex',
        zIndex: ThemeProvider.zIndex.drawer - 1,
    },
    drawer: {
        width: 60,
    }
}

class Sidebar extends Component {
    render() {
        return (
            <Box>
                <Drawer
                    variant="permanent"
                >
                <Toolbar />
                <Box>
                    <List>
                        {['Add', 'Inbox'].map((text, index) => (
                            <ListItem button key={text}>
                                <ListItemIcon>{index % 2 === 0 ? <AddBoxIcon /> : <InboxIcon />}</ListItemIcon>
                            </ListItem>
                        ))}
                    </List>
                    <Divider />
                    <List>
                        {['Add', 'Inbox'].map((text, index) => (
                            <ListItem button key={text}>
                                <ListItemIcon>{index % 2 === 0 ? <AddBoxIcon /> : <InboxIcon />}</ListItemIcon>
                            </ListItem>
                        ))}
                    </List>
                    <Divider />
                </Box>
                </Drawer>
            </Box>

        );
    }
}

export default (Sidebar);
